import React from 'react';
import PostItem from "./PostItem";

const PostList = ({posts}) => {
    return (
        <div className='postList'>
            <h1 style={{color: "#dcbffa", textAli: "center"}}>
                Список постов
            </h1>
            {posts.map((post) => 
                <PostItem post={post} key={post.id}/>
            )}
        </div>
    )
}

export default PostList;
